import React, { useContext } from 'react'
import EtlapKontextus from '../../Kontextus/Etlap-kontextus';

const Termek = (props) => {
  const {id,termekNev,ar,termekKep} = props.data;
  const {addToRendeles} = useContext(EtlapKontextus);
  let Itemid;
  return (
    <div className='termek'>
      <img src={termekKep}></img>
      <div className='leiras'>
           <p>
            <b>{termekNev}</b>
            </p>
            <p>
            <b>{ar}</b>
            </p>
      </div>
      <button className='addTocartBttn' onClick={() => addToRendeles(Itemid)}>Hozzáadás a rendeléshez</button>
    </div>
  )
}

export default Termek
